@import url("https://fonts.googleapis.com/css2?family=Montserrat:wght@400;700&display=swap");
body {
  font-family: "Montserrat", sans-serif;
  background-color: #FFFFFF;
  margin: 0;
  padding: 0;
  box-sizing: border-box;
}

header {
  background: url("/e2c25b38793863b1dd270078bd88f8cd.png") no-repeat center/cover;
  background-position: bottom;
  background-size: 276px 234px;
  height: 600px;
  background-color: #75BC97;
  position: relative;
  padding-bottom: 12px;
  padding-left: 20px;
  background-origin: content-box;
  z-index: 0;
}

.overlaping-content {
  z-index: 3;
  position: absolute;
  display: flex;
  justify-content: center;
  align-items: flex-start;
  flex-direction: column;
  padding: 32px;
}
.overlaping-content h1 {
  color: #FFFFFF;
  font-size: 40px;
}

.overlaping-image {
  z-index: 2;
  top: 0;
  left: 50%;
  transform: translate(-50%, 0);
  position: absolute;
}
.overlaping-image img {
  width: 320px;
  height: 412px;
}

.section-form {
  background-color: #FFFFFF;
}

form {
  display: flex;
  flex-flow: wrap;
  justify-content: center;
}
form .question {
  display: flex;
  flex-direction: column;
  margin: 32px;
}
form .question label {
  margin: 12px 0 32px 0;
  color: #A8A8A8;
  font-size: 0.875rem;
}
form .question img {
  width: 75px;
  height: 75px;
}
form .question img[alt=Wateringcan] {
  width: 103px;
  -moz-transform: scale(-1, -1);
  -o-transform: scale(-1, -1);
  -webkit-transform: scale(-1, -1);
  transform: scale(-1, 1);
}

.results-container {
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  background-color: #F2F2F2;
  min-height: 23rem;
  text-align: center;
  padding: 12px;
}

.hidden {
  display: none !important;
}

.no-results-content {
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  width: 100%;
  max-width: 100%;
}
.no-results-content.title {
  font-size: 2.8125rem;
  color: #A8A8A8;
  line-height: 55px;
  margin-bottom: 1rem;
}
.no-results-content.instructions-no-results {
  font-size: 1rem;
  margin-bottom: 1rem;
  line-height: 27px;
  color: #A8A8A8;
}
.no-results-content img {
  width: 84.81px;
  height: 164.65px;
  margin: 1rem;
}

.results-content {
  display: flex;
  flex-direction: column;
  justify-content: center;
  text-align: left;
}
.results-content.title {
  font-size: 2.5rem;
  color: #0C261C;
  line-height: 49px;
  font-weight: bold;
  margin: 21px;
}
.results-content img[alt=Pick] {
  width: 146px;
  height: 72px;
  margin: 21px;
}

.carousel {
  white-space: nowrap;
  overflow: auto;
  float: left;
}

.dropdown-el {
  margin-top: 20vh;
  min-width: 12em;
  position: relative;
  display: inline-block;
  margin-right: 1em;
  min-height: 2em;
  max-height: 2em;
  overflow: hidden;
  top: 0.5em;
  cursor: pointer;
  text-align: left;
  white-space: nowrap;
  color: #444;
  outline: none;
  border: 0.06em solid transparent;
  border-radius: 1em;
  background-color: #cde4f5;
  transition: 0.3s all ease-in-out;
}
.dropdown-el input:focus + label {
  background: #def;
}
.dropdown-el input {
  width: 1px;
  height: 1px;
  display: inline-block;
  position: absolute;
  opacity: 0.01;
}
.dropdown-el label {
  border-top: 0.06em solid #d9d9d9;
  display: block;
  height: 2em;
  line-height: 2em;
  padding-left: 1em;
  padding-right: 3em;
  cursor: pointer;
  position: relative;
  transition: 0.3s color ease-in-out;
}
.dropdown-el label:nth-child(2) {
  margin-top: 2em;
  border-top: 0.06em solid #d9d9d9;
}
.dropdown-el input:checked + label {
  display: block;
  border-top: none;
  position: absolute;
  top: 0;
  width: 100%;
}
.dropdown-el input:checked + label:nth-child(2) {
  margin-top: 0;
  position: relative;
}
.dropdown-el::after {
  content: "";
  position: absolute;
  right: 0.8em;
  top: 0.9em;
  border: 0.3em solid #3694d7;
  border-color: #3694d7 transparent transparent transparent;
  transition: 0.4s all ease-in-out;
}
.dropdown-el.expanded {
  border: 0.06em solid #3694d7;
  background: #fff;
  border-radius: 0.25em;
  padding: 0;
  box-shadow: rgba(0, 0, 0, 0.1) 3px 3px 5px 0px;
  max-height: 15em;
}
.dropdown-el.expanded label {
  border-top: 0.06em solid #d9d9d9;
}
.dropdown-el.expanded label:hover {
  color: #3694d7;
}
.dropdown-el.expanded input:checked + label {
  color: #3694d7;
}
.dropdown-el.expanded::after {
  transform: rotate(-180deg);
  top: 0.55em;
}

